import { createGlobalStyle } from "styled-components";
import Header from "./Header";

const GlobalStyles = createGlobalStyle`
html {
  --red: #ff0000;
  --black: #393939;
  --gray: #3a3a3a;
  --lightGray: #e1e1e1;
  --offWhite: #ededed;
  --maxWidth: 1000px;
  --bs: 0 12px 24px 0 rgba(0,0,0,0.09);
}

`;

export default function Page({ children }) {
  return (
    <div>
      <GlobalStyles />
      <Header />
      <h1>Page Layout</h1>
      {children}
    </div>
  );
}
